  /// < Audio buffer size in sample FRAMES (total samples divided by channel count)
  @ffi.Uint16()
  int samples;

  /// < Necessary for some compile environments
  @ffi.Uint16()
  int padding;

  /// < Audio buffer size in bytes (calculated)
  @ffi.Uint32()
